When you want the abstract service definition to be shared but without concreate implementations, you should use #[export_trait] on the trait definition and #[export_trait_impl] on the concrete trait implementation. Please note that the default service name hence will be the name of the trait NOT that of the struct. Suppose we will have three separate crates "example-service" as the service definition, "example-server" acting as the server, and "example-client" acting as the client which can also be found in the GitHub examples ( service , server , client ). We are going to define the RPC service just as a trait in "example-service". // example-service/src/lib.rs
use async_trait::async_trait;
use toy_rpc::macros::export_trait; #[async_trait]
#[export_trait] // The default service name will be "Arith"
pub trait Arith { // let's mark both `add(...)` and `subtract(...)` as RPC method #[export_method] async fn add(&self, args: (i32, i32)) -> Result<i32, String>; #[export_method] async fn subtract(&self, args: (i32, i32)) -> Result<i32, String>; // some method that we don't want to export fn say_hi(&self);
} We will continue to use this example in the Server and Client chapters.

