use std::sync::Arc;
use toy_rpc::Server; use toy_rpc_quickstart::rpc::Echo; #[tokio::main]
async fn main() { let addr = "127.0.0.1:23333"; // Creates an instance of the `Echo` service let echo_service = Arc::new( Echo { } ); let server = Server::builder() .register(echo_service) // register service .build(); let listener = TcpListener::bind(addr).await.unwrap(); // Run the server in a separate task let handle = task::spawn(async move { println!("Starting server at {}", &addr); server.accept(listener).await.unwrap(); }); handle.await.expect("Error running the RPC server");
}
